import React from "react";
import "../AsideLogoUsers/AsideLogoUsers.css";
import { Link } from "react-router-dom";

function AsideLogoUsers() {
    return (
        <div className="aside-logo">
            <div className="div-back-users-list">
                <Link to="/users-list" className="link-to-users-list">Back to users</Link>
            </div>
            <img src="/multimedia/symbol-05.png" id="logo-aside" width="220" alt="Agile-Scrum-logo"/>
        </div>
    );
}

export default AsideLogoUsers;
